商品の特徴<br>＊パネル組み立て式のワンちゃん用のサークルです。<br>＊パネルのサイズは、50x50cmと50x70cmの2種類(各々別売)が用意されています。<br>＊パネルを専用のコネクターにはめ込むだけで、簡単に組立できます。<br>＊継ぎ足し用パネルも販売されているので、パネルを増やして、様々にレイアウト可能です。<br>＊パネル内側はポリプロピレン張りなので、やや頼りない印象ですが、組立てみると、結構しっかりしています。<br>＊サークルのように使用するだけでなく、2枚を連結して簡易ゲートとしても使えます。<br>＊通常のサークルより随分軽量ですので、持ち運びやすく、女性の飼い主さんにもオススメです。<br><br>商品区分；犬用サークル<br>メーカー；ユーザー<br><br>セット内容；パネル(50ｘ70cm)8枚、専用コネクター16個<br>パネル1枚の重量；344g<br>材質；パネル:PP、スチール コネクター:ABS樹脂<br>生産国；中国<br><br>＊パネルとコネクターの接続はラバーハンマー（ゴム製のトンカチ）がオススメです。<br>ラバーハンマーはホームセンターなどで販売されています。<br>＊パネルを上から押さえつけて無理にコネクターに接続しようとするとパネルのフレームが変形する場合がありますので、ご注意ください。</b><br><br><br>低価格販売＝低コスト運営のためにご協力お願いいたします。<br><font color="red"><b>―――――――――――――――――――――――――――――――――――――</b></font><br><br><font color="red"><b>こちらの商品は大型商品です。<br>ご注文の際は、こちらの商品１個のみでご注文をお願いいたします。</b></font><br><br><font color="red"><b>―――――――――――――――――――――――――――――――――――――</b></font><br>ご注文確定前に、今一度、ご注文内容、配送先情報の確認をお願いいたします。 <br><br><style type="text/css">

